@Component({
  selector: 'app-home',
  templateUrl: './home.component.html',
  styleUrls: ['./home.component.scss']
})
export class HomeComponent {

}
<section id="home">
<div class="container">
<div class="row justify-center">
  <div class="col-8"><h1>Jolanta Pisulska</h1></div>
